import React, { useEffect } from 'react'

import Navbar from '../components/Navbar';

function Dashboard() {

  useEffect(() => {
    document.title = 'Kemal Gündoğdu'
  });

  return (
    <div className="min-h-screen max-w-2xl mx-auto font-inter">
      <Navbar />
      Dashboard
    </div>
  )
}

export default Dashboard
